INSERT INTO `tbeventos` (`ID_titulo`, `Titulo`, `Subtitulo`, `Fecha`, `Hora`, `Imagen`, `Descripcion`, `Lugar`, `Enlace`, `Estado`) VALUES
(1, 'Taller de HTML5 Y CSS3', 'Fundamentos de HTML5 y CSS', '2019-03-07', '08:00:00', , 'Este curso está diseñado para ilustrar, de forma introductoria, los elementos básicos necesarios para comenzar a construir, estructurar y dar estilo a una página web. Además de presentar una iniciación al uso de HTML para definir los elementos de la página y de CSS para personalizar su estilo, también cubre nuevos aspectos muy utilizados incluidos en las versiones más recientes: HTML5 y CSS3, por lo que este curso te será útil ya sea que quieras iniciarte en estos tópicos o refrescar tus conocimientos.', 'Auditorio FAC. Ing. SISTEMAS - UNICA', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d2022.665604802437!2d-77.02341223861453!3d-12.050865904562169!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x9105c8b011c816cb%3A0xdd0d427618572f0!2sPlaza+Italia!5e0!3m2!1ses-419!2spe!4v1552823402142\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0\" allowfullscreen></iframe>', 'FINALIZADO');
INSERT INTO `tbeventos` (`ID_titulo`, `Titulo`, `Subtitulo`, `Fecha`, `Hora`, `Imagen`, `Descripcion`, `Lugar`, `Enlace`, `Estado`) VALUES
(3, 'Concurso de VideoGames', 'Primer Concurso de Creación de Juegos Digitales', '2019-02-26', '22:56:00', , 'El equipo de MTDeveloper Ica y la Fac. Ing. Sistemas de la UNICA a través de la Dirección General de Ciencias y Tecnología, se complacen en convocar al primer Concurso de Videojuegos 2019, bajo el lema “Cumple tus sueños”.', 'Auditorio FAC. Ing. SISTEMAS - UNICA', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d1321.8987498220029!2d2.343691122662404!3d48.86246621654775!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x47e66e1f06e2b70f%3A0x40b82c3688c9460!2zUGFyw61zLCBGcmFuY2lh!5e0!3m2!1ses-419!2spe!4v1552823801894\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0\" allowfullscreen></iframe>', 'ACTIVO');
