(4, 'Global Azure Bootcamp 2019', 'Evento Mundial de Global Azure Bootcamp', '2019-04-19', '10:49:00', , 'El 21 de abril de 2019, los usuarios de Azure de todo el mundo se reunieran para compartir las habilidades e ideas esenciales de Azure ', 'Auditorio FAC. Ing. SISTEMAS - UNICA', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d2022.665604802437!2d-77.02341223861453!3d-12.050865904562169!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x9105c8b011c816cb%3A0xdd0d427618572f0!2sPlaza+Italia!5e0!3m2!1ses-419!2spe!4v1552823402142\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0\" allowfullscreen></iframe>', 'ACTIVO');
